import { MDBCard,MDBCardTitle, MDBCardText,MDBCardImage,MDBCardBody} from 'mdbreact';
import { ExternalLink } from 'react-external-link';

export default function Home() {
    return (
<div className=" col-12 col-md-10 ">
    <MDBCard style={{ width: "22rem" }}>
    <ExternalLink href= "https://www.facebook.com/anarchy009"><MDBCardImage  className="img-fluid" src='../assets/face.png' waves /></ExternalLink>

    <MDBCardBody>
      <MDBCardTitle  className='row justify-content-center'>My FaceBook</MDBCardTitle>
      <MDBCardText style={{ fontSize: "2rem" }} className='row justify-content-center' >
      Hossein Haghighat
      </MDBCardText>
    </MDBCardBody>
  </MDBCard>
</div> 
    )
}
